import React from "react";
import { Route, Routes, Link, BrowserRouter } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css"; // Import Bootstrap CSS
import "./App.css";
import About from "./pages/About";
import Projects from "./pages/Projects.js";
import External from "./pages/External";
import Home from "./pages/Home";

function App() {
  const audio = new Audio();
  audio.src = "./click.mp4"
  return (
    <BrowserRouter>
      <div>
        <div className="navbar">
          <Link to="/home" onClick={audio.play()}>Home</Link>
          <Link to="/projects" onClick={audio.play()}>Projects</Link>
          <Link to="/about" onClick={audio.play()}>About</Link>
          <Link to="/external">External Links</Link>
        </div>

        <div className="container mt-5">
          <div className="row">
            <div className="col-md-6">
              <div className="image-container">
                <img className="image" alt="skull-art" src="/skull.png"/>
              </div>
            </div>

            <div className="col-md-6">
              <div className="view-container">
                <Routes>
                  <Route path="/projects" element={<Projects />} />
                  <Route path="/about" element={<About />} />
                  <Route path="/external" element={<External />} />
                  <Route path="/home" element={<Home />} />
                </Routes>
              </div>
            </div>
          </div>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
